import React from 'react';

const About = () => {
    return (
        <div className='about'>
            <img src="../src/about.jpg" alt='about-image'></img>
            <div className='about-text'>
                <h2>Nice to meet you</h2>

            </div>
        </div>
    );
};

export default About;
